eholder:"例：Webhookへ転送されたメッセージ",rule_sql_tips_title:"SQLによる条件付きフィルタリングとデータ処理：",sql_tips_html:'<p>EMQXは、メッセージが公開されてイベントがトリガーされると、ルールエンジンをトリガーします。トリガー条件を適応するルールは、自体のSQLを実行し、メッセージとイベントのコンテキスト情報をフィルター処理します。</p>\n  <p class="item">ルールエンジンは、応答アクションを利用して、特定のトピックのメッセージの処理結果をデータベースに格納し、HTTPサーバーに送信し、メッセージキューKafkaまたはRabbitMQに転送し、新しいトピックまたは別のBrokerクラスターに再発行できます。各ルールに対して、複数の応答アクションをデプロイ可能です。</p>\n\n  <p>1. トピックt/#\'のメッセージを選択し、全てのフィールドを絞る：</p>\n\n  <div class="code">\n    <code>SELECT * FROM  "t/#"</code>\n  </div>\n\n  <p>2. トピック\'t/a\'のメッセージを選択し、JSON形式のメッセージからフィールド"x"を絞る：</p>\n\n  <div class="code">\n    <code>SELECT payload.x as x FROM "t/a"</code>\n  </div>\n\n  <p class="item">ルールエンジンは$events/で始まる仮トピック（イベントトピック）を使用して、EMQX内部のイベントを処理します，内部イベントはもっと細かいメッセージ制御およびクライアントアクション処理機能を提供し、QoS 1 QoS 2メッセージ到着レコード、デバイスのオンラインおよびオフラインレコードなどのサービスで使用できます。<p>\n\n  <p>1. クライアント接続イベントを選択し、ユーザ名\'emqx\'の設備を接続して接続情報を取得する：</p>\n  <div class="code">\n    <code>SELECT clientid, connected_at FROM "$events/client_connected" WHERE username = \'emqx\'</code>\n  </div>\n\n  <p>ルールエンジンとSQLの詳細説明について、EMQXのドキュメントを参考してください。</p>',condition_screening:"条件付きフィルタリング",topic_condition:"トピック条件",message_publish_topic:"メッセージ公開トピック",set_action:"応答アクション",sql_required:"SQLを入力してください",actions_required:"アクションを選択してください",rule_action_tips_title:"アクションを定義する",action_tips_html:"\n<p>1. メッセージをメッセージサーバに再公開</p>\n<span>メッセージをbrokerに再公開、目標トピックが必要</span>\n<p>2. メッセージをWebhookへ転送する</p>\n<span>メッセージをHTTP Webhookへ転送する</span>",resource_title:"リソース",resource_des:"リソース詳細",resource_id:"リソースID",id_len_tip:"最大64ビットまで",id_char_tip:"入力可能文字：半角英数字・「_（アンダースコア）」・「:（コロン）」のみ",type_required:"リソースタイプを選択してください",resource_details:"リソース詳細",config_info:"構成情報",events_rule:"イベントルール",create_rule:"新規ルール",events_type:"イベントタイプ",clientid_doc:"カレントMQTTクライアントID",username_doc:"カレントMQTTユーザ名",event_doc:"トリガーイベント名",id_doc:"MQTTメッセージid",payload_doc:"JSONフォーマットの場合、payloadが自動的にデコードされます。 SQL文中にpayload.xでオブジェクト情報を取得することができます",peerhost_doc:"クライアントアドレス",qos_doc:"QoS 0、1、2 のメッセージ中の列挙型"